import { Box, Typography } from "@mui/material";
import React from "react";

function Top() {
  return (
    <Box sx={{ paddingTop: "10px", borderRadius: 1, height: "50px" }}>
      <Typography
        variant="h3"
        sx={{ color: "white", fontWeight: "700", letterSpacing: "8px" }}
      >
        Touch Typing
      </Typography>
    </Box>
  );
}

export default Top;
